import React from 'react';

//import css
import './cardDetails.css'

export const CardDetails = ({image, name, temperament, height, weight, lifeSpan}) => {
    return (
        <>
            <div className = 'div_cardetails'>
                <div className = 'div_details_name'>
                <h1>{name}</h1>
                </div>
                <h3>{temperament}</h3>
                <img src={image} alt="" />
            </div>
                <p>{height}</p>
                <p>{weight}</p>
                <p>{lifeSpan}</p>
        </>
    )
};
